import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles({
  form: {
    margin: 20,
    display: 'flex'
  },
  button: {
    margin: 'auto 0',
    borderRadius: '0 5px 5px 0',
    height: 56
  },
  input: {
    borderRadius: '0 5px 5px 0'
  }
});

export default useStyles;
